import React from 'react';
import styled from 'styled-components';

import Button from '../../components/Button';


const Container = styled.div`
	background-image: url('assets/images/feature.png');
	background-repeat: no-repeat;
	background-position: center;
	height: 800px;
	text-align: center;
`;

const ButtonAndLogoSection = styled.div`
	position: relative;
	top: 645px;
`;



const feature = (props) => (
	<Container>
		<ButtonAndLogoSection>
		<Button text="Tap to Begin (You're on Feature)" link="/watch" />
			<img src="assets/images/cox-logo-gradient.png" alt="Cox logo" />
		</ButtonAndLogoSection>
	</Container>
)

export default feature;
